import '../../styles/Home.css'
function Home() {
    return ( 
    <div>
        <h3>Le Déplacement le plus agréable</h3>
        <h4>&bull;Nos vélos sont là pour vous emmener ou vous voulez</h4>
        <h4>&bull;Déplacez vous en un rien de temps grâce à nos vélos - pour nous trajet en douceur, sans effort et en toute sécurité</h4>
    </div>
    )
}
export default Home
